function Fastergerman() { /** Intentionally empty */ }

function isNone(value) {
  return value === "None" || !value
}
Fastergerman.prototype.updateSettingsForGame = function (gameToLoadId, elementIds) {
  const gameToLoad = document.getElementById(gameToLoadId).value
  elementIds = elementIds.split(",")
  for (let i = 0; i < elementIds.length; i++) {
    document.getElementById(elementIds[i]).disabled = !isNone(gameToLoad)
  }
}

Fastergerman.prototype.onGameToLoadChange = function (sourceId, targetId, elementIds) {
  const sourceElement = document.getElementById(sourceId)
  const targetElement = document.getElementById(targetId)
  if (isNone(sourceElement.value)) {
    targetElement.value = ""
  } else {
    targetElement.value = sourceElement.value
  }

  fastergerman.updateSettingsForGame(sourceId, elementIds)
}

Fastergerman.prototype.toggleDisplay = function (controlId, showText, hideText, elementId, showStyle = 'block', hideStyle = 'none') {
  const ctrElement = document.getElementById(controlId);
  const element = document.getElementById(elementId);
  if (element.style.display !== showStyle) {
    element.style.display = showStyle;
    ctrElement.value = showText
  } else {
    element.style.display = hideStyle;
    ctrElement.value = hideText
  }
}

function isValidTime(time, errorElementId, errorMessage) {
  try {
    new Date(parseFloat(time));
    return true;
  } catch (e) {
    console.error("Invalid time: " + time + ", caused by -> \n" + e);
    document.getElementById(errorElementId).innerText = errorMessage;
    return false;
  }
}

function toBoolean(val) {
  return val === true || val?.toString().toLowerCase() === "true"
}

Fastergerman.prototype.startCountdown = function(endTime, formId, countdownElementId,
                                                 messageElementId, lastAnswerCorrect,
                                                 errorElementId, errorMessage, production) {
  const debug = toBoolean(production) !== true;
  if (debug) console.log("End time: " + endTime);
  if (endTime === "0" || endTime === 0) {
    return;
  }
  if (!isValidTime(endTime, errorElementId, errorMessage)) {
    return;
  }
  if (debug) console.log("End date: " + Date(parseFloat(endTime)))
  if (debug) console.log("Countdown: " + document.getElementById(countdownElementId).innerText)

  const intervalId = setInterval(function(){
    const countdownElement = document.getElementById(countdownElementId);
    countdownElement.innerText = "" + (parseInt(countdownElement.innerText) - 1);
  }, 1000);

  const timeLeft = endTime - Date.now();
  if (debug) console.log("Time left: " + timeLeft);
  if (timeLeft <= 0) {
    document.getElementById(formId).submit();
    return;
  }
  const countdownTimeoutId = setTimeout(function(){
    if (debug) console.log("Clearing interval");
    if (intervalId) {
      clearInterval(intervalId);
    }
    if (debug) console.log("Clearing countdown");
    if (countdownTimeoutId) {
      clearTimeout(countdownTimeoutId);
    }
    document.getElementById(formId).submit();
  }, timeLeft);

  if (debug) console.log("Last answer correct " + lastAnswerCorrect);
  if (lastAnswerCorrect && lastAnswerCorrect !== 'None') {
    if (toBoolean(lastAnswerCorrect)) {
      beep();
    } else {
      buzz();
    }
  }

  const messageTimeoutId = setTimeout(function() {
    if (debug) console.log("Clearing " + messageElementId);
    if (messageTimeoutId) {
      clearTimeout(messageTimeoutId);
    }
    document.getElementById(messageElementId).innerHTML = ""
  }, 2000);
}

function beep() {
  const sound = new Audio("data:audio/wav;base64,");
  sound.play();
}

function buzz() {
  const sound = new Audio("data:audio/wav;base64,");
  sound.play();
}

const fastergerman = new Fastergerman();
